description:
Su profesor le gustaría que usted hiciera un programa con las siguientes características:


	Coloque siete espacios en blanco y coloque el carácter 'A';
	Coloque seis espacios en blanco y coloque el carácter 'B', un espacio en blanco y el carácter 'B';
	Coloque cinco espacios en blanco y coloque el carácter 'C', tres espacios en blanco y el carácter 'C';
	Coloque cuatro espacios en blanco y coloque el carácter 'D', cinco espacios en blanco y el carácter 'D';
	Coloque tres espacios en blanco y coloque el carácter 'E', siete espacios en blanco y el carácter 'E';
	Repita el procedimiento 4;
	Repita el procedimiento 3;
	Repita el procedimiento 2;
	Repita el procedimiento 1.
